import React from 'react'
import { CourseConsumer } from "./CourseContext";

export default function Cart() {

    return (
        <div>
            <h4>Your Cart:</h4>
            <CourseConsumer>
                {(datas) => {
                    datas.map((data)=>{
                        <p>{data.title}</p>
                    })
                } }
            </CourseConsumer>

        </div>
    )
}
